import './App.css';

const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src='asd' alt='jopa'/>
      </header>
      <nav className='nav'>
        <div>
          Profile
        </div>
        <div>
          <div>Messages</div>
        </div>
      </nav>
      <div className='content'>
        Main content
      </div>
    </div>
  );
}

export default App;
